import './App.css';
import Minesweeper from './pages/Minesweeper';

function App() {
  return (
    <div className="App">
      <div>
        <h1>Minesweeper Game</h1>
        <Minesweeper width={10} height={10} mineCount={10} />
      </div>
    </div>
  );
}

export default App;
